pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/interfaces/IERC2981.sol";
import "./@rarible/royalties/contracts/RoyaltiesV2.sol";
import "./@rarible/royalties/contracts/LibRoyaltiesV2.sol";
import "./ForTheLolzForSale.sol";

contract ForTheLolzItem is Ownable, ERC721, ERC721URIStorage, ERC721Enumerable, IERC2981, RoyaltiesV2 {
  ForTheLolzForSale internal forSaleCollection;

  address payable internal creator;
  uint256 creatorPercentageFee;
  uint256 agencyPercentageFee;
  uint256 firstSaleCreatorPercentage;

  function percent(uint256 _value, uint256 _percent) internal pure returns (uint256)  {
    return _value * _percent / 10000;
  }

  event RoyaltyPayout(
    address owner, address payable creator,
    uint256 salesPrice,
    uint256 agencyFee, uint256 creatorFee
  );

  constructor(
    address payable _creator, ForTheLolzForSale _forSaleCollection,
    string memory _name, uint256 _firstSaleCreatorPercentage,
    uint256 _creatorPercentageFee, uint256 _agencyPercentageFee)

    ERC721(_name, "MTA")  {
    forSaleCollection = _forSaleCollection;
    creator = _creator;
    creatorPercentageFee = _creatorPercentageFee;
    agencyPercentageFee = _agencyPercentageFee;
    firstSaleCreatorPercentage = _firstSaleCreatorPercentage;
  }

  /* public */
  function changeCreator(address payable _creator) onlyOwner public {
    creator = _creator;
  }

  function changeFirstSaleCreatorFees(uint256 _firstSaleCreatorPercentage) onlyOwner public {
    firstSaleCreatorPercentage = _firstSaleCreatorPercentage;
  }

  function changeFees(uint256 _creatorPercentageFee, uint256 _agencyPercentageFee) onlyOwner public {
    creatorPercentageFee = _creatorPercentageFee;
    agencyPercentageFee = _agencyPercentageFee;
  }

  function changeForSaleCollection(ForTheLolzForSale collection) onlyOwner public {
    forSaleCollection = collection;
  }

  function mint(address _to, uint256 _tokenId) onlyOwner public {
    super._mint(_to, _tokenId);
  }

  function buyToken(uint256 forSaleTokenId) public payable {
    uint256 collectionTokenId = forSaleCollection.getCollectionTokenId(forSaleTokenId);
    uint256 availableArtworks = forSaleCollection.getAvailableNumberOfArtworks(forSaleTokenId);
    uint256 tokenId = collectionTokenId - availableArtworks + 1;
    uint256 price = forSaleCollection.getTokenPrice(forSaleTokenId);
    require(msg.value == price, "not enough ETH paid");
    uint256 payoutCreator = percent(msg.value, firstSaleCreatorPercentage);
    uint256 payoutOwner = msg.value - payoutCreator;
    payable(owner()).transfer(payoutOwner);
    payable(creator).transfer(payoutCreator);

    forSaleCollection.sellItem(forSaleTokenId);
    _mint(address(msg.sender), tokenId);

    string memory newTokenURI = forSaleCollection.tokenURI(forSaleTokenId);
    _setTokenURI(tokenId, newTokenURI);
  }

  /* ERC165 */
  function supportsInterface(bytes4 interfaceId)
    public view virtual override(ERC721, ERC721Enumerable, IERC165) returns (bool) {
    return interfaceId == type(IERC2981).interfaceId ||
      interfaceId == LibRoyaltiesV2._INTERFACE_ID_ROYALTIES ||
      super.supportsInterface(interfaceId);
  }

  /* ERC721, ERC721Enumerable */
  function _beforeTokenTransfer(address from, address to, uint256 tokenId)
    internal virtual override(ERC721, ERC721Enumerable) {
    super._beforeTokenTransfer(from, to, tokenId);
  }

  /* ERC721URIStorage */
  function tokenURI(uint256 tokenId)
    public view virtual override(ERC721, ERC721URIStorage) returns (string memory) {
    return super.tokenURI(tokenId);
  }

  function _burn(uint256 tokenId) internal virtual override(ERC721, ERC721URIStorage) {
    super._burn(tokenId);
  }

  /* IERC2981 */
  function royaltyInfo(uint256 /*_tokenId*/, uint256 _salePrice)
    external view returns (
        address receiver,
        uint256 royaltyAmount
  ) {
    uint256 computedRoyaltyAmount = percent(_salePrice, agencyPercentageFee+creatorPercentageFee);
    return (address(this), computedRoyaltyAmount);
  }

  /* Rarible RoyaltiesV2 */
  function getRaribleV2Royalties(uint256 /*id*/) external view returns (LibPart.Part[] memory) {
    LibPart.Part[] memory _royalties = new LibPart.Part[](2);
    _royalties[0].value = uint96(agencyPercentageFee);
    _royalties[0].account = payable(owner());
    _royalties[1].value = uint96(creatorPercentageFee);
    _royalties[1].account = payable(creator);
    return _royalties;
  }

  receive() external payable {
    // fallback function only to receive ether
    uint256 salesPrice = (msg.value * 10000) / (agencyPercentageFee+creatorPercentageFee);
    uint256 creatorFee = percent(salesPrice, creatorPercentageFee);
    uint256 agencyFee = msg.value - creatorFee;
    payable(creator).transfer(creatorFee);
    payable(owner()).transfer(agencyFee);
    emit RoyaltyPayout(owner(), creator, salesPrice, agencyFee, creatorFee);
  }
}
